[
    {
        "WidgetSubTitle": "Job's Delayed or On Time by status",
        "WidgetType": "grid",
        "WidgetFilterField": "",
        "WidgetColor": "",
        "WidgetHeight": "500",
        "WidgetHeader": {
            "showContextInfo": false,
            "WidgetPeriodChooser": {
                "type": "year",
                "visible": false
            } ,
            "WidgetMetrics": {
                "visible": true,
                "Metrics": [
                    {
                        "visible": true,
                        "metricName": "# Delayed Jobs",
                        "metricFieldValue": "DelayedJobsGrandTotal"
                    } 
                ]
            } ,
            "showSubTitle": true,
            "showTitle": true
        } ,
        "WidgetDataSources": {
            "main": {
                "type": "queryText",
                "value": "select j.effort, j.Job, ws.Name as Stage, j.Project, j.AgreedDate as Enddate, j.Oid, ISNULL(ws.Color, wst.Color) as Color, DATEDIFF(day,getdate(),AgreedDate) as Days, sum(iif((ws.name ='in Tests' or ws.name='Move to Production' or ws.name='on Hold' or ws.name='Open' or ws.name='Request Approval' or ws.name='Request more information' or ws.name ='Request Uat' or ws.name='Requirement Approval' or ws.name='Under Analysis') and AgreedDate < getdate(), 1, 0)) over() as DelayedJobsGrandTotal from SkillJob j, WorkflowState ws, WorkflowStateType wst where ws.Oid = j.WorkflowStateId and wst.Oid = j.WorkflowStateTypeId and j.Department = 'Support' and ws.name in ('in Tests','Move to Production','on Hold', 'Open', 'Request Approval','Request more information', 'Request Uat', 'Requirement Approval','Under Analysis') /*[DateFilter]*/ and j.AgreedDate >= @FromDate and j.AgreedDate <= @ToDate /*[/DateFilter]*/"
            } 
        } ,
        "QueryConfiguration": {} 
    } 
]

